//   time: number
// }

const Match: React.FC = () => {
  const count = useContext(UserData);

  const handleClickMatch = () => {
    console.log("開始")
    console.log({count})
    console.log("終了")
  }

  return (
    <>
      <div className="StartSpace">
        <button className="btn StartButton" onClick={handleClickMatch}>Start</button>
      </div>
    </>
  );
};

export default Match;
